import React, { Component } from 'react';
import Login from './pages/login';

function App() {
  function renderMainRouter(listRouter) {
    return listRouter.map((router, index) => {
      return <RouteMain {...router} key={index} />;
    });
  }
  return (
    <Login />
  )
}

export default App;
